import React from 'react'
import CardItem from './CardItem'
import { Col, Container, Row } from 'react-bootstrap'


const Home = ({ data }) => {

    const characterList = data?.characters.results

    console.log(characterList)
    const dataDummy = [
        {
            id: '1',
            name: 'Rick shancez',
            image: 'Pic',
            species: 'human',
            status: 'alive',
            location: {
                'name': 'Earth (Replacement Dimension)'
            }
        },

        {
            id: '2',
            name: 'Bro Tony',
            image: 'Pic',
            species: 'Mamalia',
            status: 'alive',
            location: {
                'name': 'Jupiters (Jonasd Dimension)'
            }
        },

        {
            id: '3',
            name: 'Anjai Sarungga',
            image: 'Pic',
            species: 'Fish',
            status: 'alive',
            location: {
                'name': 'Mars (Junars Dimension)'
            }
        },

        {
            id: '4',
            name: 'Tony Stark',
            image: 'Pic',
            species: 'Iron Man',
            status: 'alive',
            location: {
                'name': 'Saturnus (Avengers Dimension)'
            }
        }
    ]

  return (
    <div className='mx-auto'>
        <Container>
            <Row>
                {
                    dataDummy.map((data, index) => {
                        return <Col className='mt-3' key={index}><CardItem data={data}/></Col>     
                    })
                }  
            </Row>
        </Container>
    </div>
  )
}

export default Home
